	function generateFloor(){
		var geo = new THREE.PlaneGeometry(200,200,20,20);
		var mat = new THREE.MeshBasicMaterial({color:0xbbcdd});
		var floor = new THREE.Mesh(geo, mat);
		floor.rotation.x = -90 * Math.PI / 180;
		floor.receiveShadow = true;
		scene.add(floor);
		
	
	}
	function generateCity(buildingCount, material){
	
		var geo = new THREE.BoxGeometry(1,1,1);
		geo.applyMatrix(new THREE.Matrix4().makeTranslation(0,0.5,0));
		var cityGeometry = new THREE.Geometry();
		
		_.range(0,buildingCount).forEach(function(index){
			
			var building = generateBuilding(geo);
			THREE.GeometryUtils.merge(cityGeometry, building);
		});
		
		return new THREE.Mesh(cityGeometry, material);
		
	}
	
	function generateBuilding(geo){
		
		var building = new THREE.Mesh(geo.clone());
		
		building.position.x = Math.floor((Math.random()*400 -200) * 4);
		//building.position.y = Math.floor((Math.random()*200 -100) * 4);
		building.position.z = Math.floor((Math.random()*400 -200) * 4);
		building.scale.x = Math.random()*50 +10;
		building.scale.y = Math.random()*building.scale.x*8 + 8;
		building.scale.z = building.scale.x;
		return building;
	
	}
	
	function draw()
	{	
	
		renderer.render(scene, camera);
		controls.update(clock.getDelta());
		requestAnimationFrame(draw);
	}
	
	function drawMap(scene, map){
	
		var waterTexture = THREE.ImageUtils.loadTexture('textures/water.png');
		var waterMaterial = new THREE.MeshBasicMaterial({map:waterTexture});
	
		var dirtTexture = THREE.ImageUtils.loadTexture('textures/dirt.png');
		var dirtMaterial = new THREE.MeshBasicMaterial({map:dirtTexture});	
	
		var stoneTexture = THREE.ImageUtils.loadTexture('textures/stone.png');
		var stoneMaterial = new THREE.MeshBasicMaterial({map:stoneTexture});		
	
		var grassTexture = THREE.ImageUtils.loadTexture('textures/grass.png');
		var grassMaterial = new THREE.MeshBasicMaterial({map:grassTexture});	
		
		for(var x in map){
	
			var item = map[x];
			var geo = new THREE.BoxGeometry(item.Shape.Width,item.Shape.Height, item.Shape.Height);
			var height = item.Shape.Height;
			if(item.Solid === 0){
				height = item.Shape.Height*2;
				geo = new THREE.BoxGeometry(item.Shape.Width, height, item.Shape.Height);
			}
			if(item.Solid === 1){
				height = item.Shape.Height*2;
				geo = new THREE.BoxGeometry(item.Shape.Width,height, item.Shape.Height);
			}
			
			var mat = dirtMaterial;//new THREE.MeshBasicMaterial({color:item.Color});
			if(item.Color === '#6E6E6E'){
				mat = stoneMaterial;
			}
	
			
			if(item.Color === '#89EBF0'){
				mat = waterMaterial;
			}
			
			if(item.Color === '#C0F598'){
				mat = grassMaterial;
			}
			
	
			
			var block = new THREE.Mesh(geo, mat);
			block.position.x = item.Shape.Position.X;
			block.position.y = height;
			block.position.z = item.Shape.Position.Y;
			scene.add(block);
	
	
		}
	}
	
	function drawBodies(scene, bodies){
		var fireballTexture = THREE.ImageUtils.loadTexture('textures/fireball.png');
		var fireballMaterial = new THREE.MeshBasicMaterial({map:fireballTexture});		
	
		var healthTexture = THREE.ImageUtils.loadTexture('textures/health.png');
		var healthMaterial = new THREE.MeshBasicMaterial({map:healthTexture});		
	
	    
	
		for(var x in bodies){
	
			var item = bodies[x];
			
			if(item.BodyType === 'Bullet'){
				var geometry = new THREE.SphereGeometry( 10, 4, 4 );
			
				var sphere = new THREE.Mesh( geometry, fireballMaterial );
				sphere.position.y = 130;
				sphere.position.x = item.Shape.Position.X;
				sphere.position.z = item.Shape.Position.Y;
				scene.add(sphere);
			} 
			if(item.BodyType === 'LifeContainer'){
				var geometry = new THREE.SphereGeometry( 30, 10, 10 );
			
				var box = new THREE.Mesh( geometry, healthMaterial );
				box.position.y = 100;
				box.position.x = item.Shape.Position.X;
				box.position.z = item.Shape.Position.Y;
				scene.add(box);
			}
			if(item.BodyType === 'NPC'){
				var player      = new THREEx.MinecraftChar('images/Iron-Man-Minecraft-Skin.png');
				player.root.position.y = 75;
				player.root.position.x = item.Shape.Position.X;
				player.root.position.z = item.Shape.Position.Y;
	
				player.root.scale.x = player.root.scale.y = player.root.scale.z = 50;
	    		player.root.rotation.y = 60 * Math.PI/180;
	    		scene.add(player.root)	
			} 
			if(item.BodyType === 'NPCAI'){
				var player      = new THREEx.MinecraftChar('images/Joker.png');
				player.root.position.y = 75;
				player.root.position.x = item.Shape.Position.X;
				player.root.position.z = item.Shape.Position.Y;
				player.root.scale.x = player.root.scale.y = player.root.scale.z = 50;
				player.root.rotation.y = -30 * Math.PI/180;
	    		scene.add(player.root)	
			}
			if(item.BodyType === 'PlayerBody'){
				var player      = new THREEx.MinecraftChar('images/Mario.png');
				player.root.position.y = 75;
				player.root.position.x = item.Shape.Position.X;
				player.root.position.z = item.Shape.Position.Y;
				player.root.scale.x = player.root.scale.y = player.root.scale.z = 50;
				player.root.rotation.y = 110 * Math.PI/180;
	    		scene.add(player.root)	
			}  
	
			
		}
	}
